 export async function createModel(model_name,inputSize,outputSize) {

  	var promise = new Promise((res, rej) => {
  
		  myWorker.postMessage({method:"createModel",params: [model_name,inputSize,outputSize]});

		  myWorker.onmessage = (message) => { 
		        res(message.data.value)     
		  }
		})
  return promise
  .then(model_name => tf.loadLayersModel('indexeddb://'+model_name))
  .then(model =>  {
  	tfvis.show.modelSummary({name: 'Model Summary'},model);
  	return model;
  	})
}

export function normalizeVectorNew(data) {
	return normalizeVector(data,undefined,undefined);
}

export function normalizeVector(data,inputMinMax_,labelMinMax_) {

 	 var inputMinMax;
	 var labelMinMax;

   if(!inputMinMax_ || !labelMinMax_){
		  var v_min = new Array(data[0].data.length).fill(Infinity);
		  var v_max = new Array(data[0].data.length).fill(-Infinity);
		  for(var i=0;i<data.length;i++){
		  	data[i].data.forEach((e,i) => {
		  		if(e<v_min[i]){
		  			v_min[i] = e;
		  		}
		  		if(e>v_max[i]){
		  			v_max[i] = e;
		  		} 
		  	}) 
		  }
	    var inputMinMax =  v_min.map((e,i) => {return {"min":v_min[i], "max":v_max[i]}})

	    var d = data.map(entry => entry.label).map(e => e==undefined ? -1 : (isFinite(e) ? e : -1));
	    var labelMinMax =  {max: 2, min: -2}
  }

    if(inputMinMax_ && labelMinMax_){
    	inputMinMax = inputMinMax_;
    	labelMinMax = labelMinMax_;
    }
    

 
    return { 
    	inputMinMax:inputMinMax,
    	labelMinMax:labelMinMax,
    } 
}

/**
 * Convert the input data to tensors that we can use for machine
 * learning. We will also do the important best practices of _shuffling_
 * the data and _normalizing_ the data
 * MPG on the y-axis.
 */
export function convertToTensor(data,norm) { 

    //const res = normalizeVector(data,inputMinMax_,labelMinMax_);

       // Step 2. Convert data to Tensor
    const inputs = data.map(d => d.data).map(entry => entry.map((e,i) => normalize(norm.inputMinMax[i].min,norm.inputMinMax[i].max)(e)))
    const labels = data.map(d => d.label).map(entry => normalize(norm.labelMinMax.min,norm.labelMinMax.max)(entry))
  
 
    return {
      inputs: [inputs, [inputs.length, inputs[0].length]],
      labels: [labels, [labels.length, 1]]
    } 
}

export function trainModel(model_name, inputs, labels) {

	var promise = new Promise((res, rej) => {
  
		  myWorker.postMessage({method:"trainModel",params: [model_name,inputs,labels]});

		  const callbacks = tfvis.show.fitCallbacks(
		  				       { name: 'Training Performance' },
          					 ['loss'],
          					 { height: 400, callbacks: ['onEpochEnd'] }); 

		  myWorker.onmessage = (message) => { 
		  			if(message.data.type=="callback"){
		  				callbacks[message.data.method](...message.data.value)		  				

		  			}else if(message.data.type=="result" && message.data.method=="trainModel"){
		        	res(message.data.value)     
		      	}
		  }
		})
  return promise;
}

