export async function import_model(model_name,default_model) {
	default_model.data.forEach(e => window.localStorage.setItem(e[0],e[1]));
	const model = await tf.loadLayersModel('localstorage://'+model_name);
	await model.save('indexeddb://'+model_name)
	console.log("TensorFlow Model "+model_name+" imported")
}

export const test_model_with_pgn = async(model_name, pgn) => {
 	var my_test_game = new Chess();
	my_test_game.load_pgn(pgn);
 
	var vectors = evaluation.getStatisticsForPositionVector(my_test_game,my_test_game.history({verbose:true}).reverse()[0])

	vectors = [vectors].map(e => {
		var target = e[evaluation.allKeys.indexOf("cp")]; 
		e.splice(evaluation.allKeys.indexOf("cp"), 1);
		return {"data": e, "label":target}
	}) 

	return await test_model_vectors(model_name, vectors,pgn);

}

const test_model_vectors = async(model_name,vectors,pgn) => {
 
 		var norm = JSON.parse(window.localStorage.getItem(model_name))

	 	var {inputs, labels} = convertToTensor(vectors,norm);

	 	return await modelPredict(model_name,inputs).then(data => {

	 		return {pgn: pgn,
							vectors: vectors, 
							norm: norm, 
							prediction: data, 
							prediction_value: data.map(e => undoNormalize(e,-2,2)),
							label: labels
				} 
	 	})
 
		

}

export async function main(arg,vectors,test_vectors) {
 
 	var myPromises = [];

	if(arg.create){ // create
		var create = createModel(arg.create.model_name,vectors[0].data.length,1)
								.then(() => {
									if(debug) console.log("Model created "+arg.create.model_name)
								})
		myPromises.push(create);
	}
	if(arg.load && !arg.create){
		if(arg.load.model_name=="default"){
			// todo find a solution, using files/https
			// load default settings.
			//JSON.parse(default_model).forEach(e => window.localStorage.setItem(e[0],e[1])); 
			//if(debug) console.log("init default model")
		}else{
			// not needed anymore, but improves startup
			// model is already cached on demand if it exists
			var load = load_model(arg.load.model_name)
								.then(() => {
									if(debug) console.log("Model cached "+arg.load.model_name)
								})
			myPromises.push(load);
		}
	} 

	if(arg.train && (arg.load || arg.create)){  	

		var model_name = (arg.load || arg.create).model_name;
		
		var norm;
		if(arg.train.initial){
			norm = normalizeVectorNew(vectors);
			if(debug) console.log("Normalization data generated")
			window.localStorage.setItem(model_name,JSON.stringify(norm))
			if(debug) console.log("Normalization data saved to localstorage")
		}else{
			norm = JSON.parse(window.localStorage.getItem(model_name))
			if(debug) console.log("Normalization data loaded from localstorage")
		}

		const {inputs, labels} = convertToTensor(vectors,norm); 
		if(debug) console.log("Data converted into {inputs, labels}")

		Promise.all(myPromises)
		
		await trainModel(model_name, inputs, labels) 
		if(debug) console.log('Done training '+model_name);

	}else{
		Promise.all(myPromises)
	}	

}